안녕하세요!기프트팩토리- '기프코(GIFCO)' 입니다.​오늘 준비한 제품은​ 'C타입 커넥터 3in1 회전식 충전케이블' 입니다.​마이크로 5핀, 라이트닝 8핀, USB C타입의 충전 단자가 하나의 바디로 구성되어 3가지 제품을 동시에 충전할 수 있는 '올인원 충전기' 랍니다.​​​​하나의 충전기에 마이크로 5핀, 라이트닝 8핀, USB C타입 충전 단자가 부착되어 있는 회전식 케이블이에요!​C젠더 타입의 올인원 충전기로, 세가지를 동시에 충전할 수 있어 매우 편리합니다. ^^​​​​​360도로 회전시켜 휴대폰과 태블릿 PC 등을 비롯해 각기 다른 가족, 지인의 기기들도 하나의 충전기로 충전해보실 수 있답니다.​1M의 넉넉한 케이블 길이로 언제 어디서든 간편한 충전이 가능해요~ㅎㅎ​​​​​편리하고 실용적인 아이템으로 기업의 홍보 마케팅을 해보세요~^^제품 중앙면에 귀사의 로고를 실크스크린 프린팅 해드립니다. (1면1컬러 무료 서비스)​​​​​화이트와 블랙을 포함해 각기 다른 매력의 컬러들로 구성되어 있어요!우리만의 색상, 취향에 맞는 컬러를 선택하여 소중한 분들께 선물해보세요~ㅎㅎ​​...​​​본 제품은 주문제작 상품으로일정량 이상(500PCS~)부터 제작이 가능한 점 참고 바랍니다.​가격이 궁금하거나 자세한 상담을 원하시는 분은 '기프코' 사이트를 방문해주시거나 아래의 번호로 연락주세요~!​​​Tel: 02)541-0123​Web: www.gifco.co.kr​ ​2
