​벌써 10일차다!목요일은 배민 7건 / 쿠팡 1건  총 8건​을 배달하였다 :)처음으로 나에게 주어진 20시간중 19시간을 다 사용하기도 한 날이다.​​​​확실히 날도 풀리니 활동하러 나오신 커넥터분들도 많이 보이고사람들도 집에서 시켜먹기보단 밖에서 외식하시는게 많이 보인다.그래도 내 원 취지는 밖에서 걷는 운동이니 점심때도 나가 부지런히 움직였다....낮에 애매하게 남는 시간에 오랜만에 네일샵에 방문했는데 쿠팡에서 지난주 금액이 입금되었다!!​생각한 금액대로 들어왔다ㅋㅋㅋ왠지 쿠팡은 꽁돈이 생긴것만 같은 기분이란 말이지...쿠팡덕분에 네일아트를 기분좋게 받았다 :)금요일에는 배민이 정산될테고 그럼 잠깐동안 통장이 배부를듯 싶다.(하지만 이번주 배민,쿠팡 성적이 안좋아 다음주에 내가 실망할듯...)​​​@드
